import React from "react";
import "./Contact.css"

const Contact = ({language}) => {


  return (
    <div className="height-contact">
    <div className="contact-container">
      <div>
        <p className="contact">{language === "EN" ? "Contact Me" : "Contáctame"}</p></div>
        <div>
        <p>{language === "EN" ? "Feel free to contact me and get to know me better" : "Siéntete libre de contactarme y conocerme mejor"}</p></div>

    </div>
    </div>
  );
};

export default Contact;
